function Navbar() {
    return (
    <div>    <div class="mask">   
            <nav class="navbar navbar-expand-md navbar-light bg-light" id="navbar">
            <div class="container-fluid">
                <img src="https://res.cloudinary.com/meal-creator/image/upload/v1662276053/icons/meal-creator-logo.png" width="50" height="50" class="d-inline-block align-top" alt=""/>
                <button class="" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
                </button>
            </div>
            </nav> 
        </div>
      </div>
    );
}

export default Navbar
